from collections import Counter


class Solution:
    def isValid(self, s: str) -> bool:
        return (len(s) % 2 == 0 and Counter(s) == Counter('01')) or (len(s) % 2 == 1 and Counter(s) == Counter('11'))

    def check(self, n: int, m: int, k: list, s: list, p: list) -> int:
        ans = 0
        for i in range(n):
            cnt = 0
            for j in range(m):
                if s[i] == '1' and self.isValid(str(k[j]) + str(i)):
                    cnt += 1
            if cnt % 2 == p[i]:
                ans += 1
        return ans

    def totalNumberOfWays(self, n: int, m: int, k: list, s: list, p: list) -> int:
        if not self.isValid(''.join(map(str, k))):
            return 0
        return self.check(n, m, k, s, p) % (10 ** 9 + 7)

