class Solution:
    def find_triplets(self, sticks: List[int]) -> int:
        sticks.sort()
        count = 0
        for i in range(0, len(sticks) - 2):
            j = i + 1
            k = len(sticks) - 1
            while j < k:
                if sticks[i] + sticks[j] + sticks[k] > sticks[i] * sticks[j] * sticks[k]:
                    k -= 1
                    count += (k - j)
                else:
                    j += 1
        return count

