class Solution:
    def minCostPath(self, cost: List[List[int]]) -> int:
        # space: O(n)
        if not cost or not cost[0]:
            return 0
        n = len(cost)
        dp = [[0] * n for _ in range(n)]
        # base case
        dp[0][0] = cost[0][0]
        for i in range(1, n):
            dp[0][i] = dp[0][i - 1] + cost[0][i]
        for i in range(1, n):
            dp[i][0] = dp[i - 1][0] + cost[i][0]
        for i in range(1, n):
            for j in range(1, n):
