        if not railway.is_endpoint():
            raise ValueError("Cannibals don't like stopping at a station. There must be no gaps.")
        result = self.find_earliest_time(railroad)
        return result

    def find_earliest_time(self, railway: Rail_road):
        result = []

        time = 0
        station = railway.stations - 1
        while station >= 0:
            time += 1
            if time % railway.arrivals == 0:
                result.append(time)
                station -= 1
            else:
                time += railway.departures

        return result

    def parse_input(self) -> Rail_road:
