        return 0 <= position.x < self.size and 0 <= position.y < self.size

    def get(self, position: Point):
        if not self.is_valid(position):
            return Field.BLOCKED
        return self.labyrinth[position.x][position.y]

    def set_start(self, start: Point):
        if self.get(start)!= Field.EMPTY:
            raise Exception(f"Impossible to set start: {start}")
        self.start = start

    def set_goal(self, goal: Point):
        if self.get(goal)!= Field.EMPTY:
            raise Exception(f"Impossible to set goal: {goal}")
        self.goal = goal

    def set_path(self, path: List[Point]):
        for point in path:
            if not self.is_valid(point):
                continue
            self.set(point, Field.PATH)

    def neighbors(self, position: Point) -> List[Point]:
        result = []
        for i in range(-1, 2):
            for j in range(-1, 2):
                if i == 0 and j == 0:
                    continue
                new_position = Point(position.x + i, position.y + j)
                if self.is_valid(new_position) and self.get(new_position)!= Field.BLOCKED:
                    result.append(new_position)
        return result

    def solve(self, is_path_valid: Callable[[Point, Point], bool]) -> bool:
