            if position == self.goal:
                self.set_path(path)
                return True
            for neighbor in self.neighbors(position):
                if is_path_valid(position, neighbor):
                    path.append(position)
                    if dfs(neighbor, path):
                        return True
                    path.pop()
            return False

        path = [self.start]
        if dfs(self.start, path):
            return True
        return False


