class Path:
    def __init__(self, moves: List[str]):
        self.moves = deque(moves)

    def pop(self) -> str:
        return self.moves.pop()

    def push(self, value: str):
        self.moves.appendleft(value)

    def __len__(self) -> int:
        return len(self.moves)

    def is_empty(self) -> bool:
        return len(self.moves) == 0

    def __repr__(self) -> str:
        return ''.join(self.moves)


class Task:
    def __init__(self, n: int, packages: List[Tuple[int, int]]):
        self.n = n
        self.packages = packages
        self.paths: List[Path] = []

    def solve(self) -> bool:
        paths = self.get_paths()
        if not paths:
            return False

        paths.sort()
        path = Path(list(paths[0].moves))
        for path in paths[1:]:
            if len(path) < len(paths[0]):
                path.push(path.pop())
            else:
                break

        if len(path)!= len(paths[0]):
            return False

        return True

    def get_paths(self) -> List[Path]:
        paths: List[Path] = []
        points: Deque[Point] = deque()
        points.append(Point(0, 0))
        while len(points) > 0:
            point: Point = points.pop()
            if self.packages.count(point) == 0:
                continue

            if self.can_move_up(point) and self.can_move_right(point):
                self.move_up(point)
                self.move_right(point)
                paths.append(Path(['U', 'R']))
                self.move_up(point, False)
                self.move_right(point, False)
                continue

            if self.can_move_left(point):
                self.move_left(point)
                paths.append(Path(['L']))
                self.move_left(point, False)
                continue

            if self.can_move_up(point):
                self.move_up(point)
                paths.append(Path(['U']))
                self.move_up(point, False)
                continue

            if self.can_move_right(point):
                self.move_right(point)
                paths.append(Path(['R']))
                self.move_right(point, False)
                continue

        return paths

    def can_move_up(self, point: Point) -> bool:
        return point.y < self.n - 1

    def can_move_right(self, point: Point) -> bool:
        return point.x < self.n - 1

    def can_move_left(self, point: Point) -> bool:
        return point.x > 0

    def move_up(self, point: Point, mirror: bool = True) -> None:
        if mirror:
