        if pi!= pj:
            self.P[pi], self.P[pj] = pj, pi

    def _find(self, i: int):
        if self.P[i]!= i:
            self.P[i] = self._find(self.P[i])
        return self.P[i]

    def solve(self):
        self._ant(0, 0)
        return self.P

