from typing import List
import collections

class Solution:
    def solution(self, stdin: List[str]) -> str:
        records = [self.record_parser(record) for record in stdin[:-1]]
        problem_counter = collections.Counter([record[1] for record in records])
        time_score = 0
        for record in records:
            if record[0] == -1:
                continue
            elif record[0] == 1:
                time_score += record[0] * 60
            elif record[1] == "A" and problem_counter["A"] > 0:
                time_score += 60
                problem_counter["A"] -= 1
            elif record[1] == "B" and problem_counter["B"] > 0:
                time_score += 30
                problem_counter["B"] -= 1
            elif record[1] == "C" and problem_counter["C"] > 0:
                time_score += 20
                problem_counter["C"] -= 1
            elif record[1] == "D" and problem_counter["D"] > 0:
                time_score += 10
                problem_counter["D"] -= 1
            else:
                time_score += 0
        return str(sum(problem_counter.values())) + " " + str(time_score)

    def record_parser(self, record: str) -> List:
        time, problem, status = record.split()
        if status == "right":
            return [1, problem]
        else:
            return [-1, problem]

solution = Solution().solution

