import datetime
import typing


class Time:
    def __init__(self, hour: int, minute: int, second: int):
        self._hour = hour
        self._minute = minute
        self._second = second

    def __str__(self) -> str:
        return "{:02d}:{:02d}:{:02d}".format(self._hour, self._minute, self._second)

    @classmethod
    def from_string(cls, time: str) -> "Time":
        hour, minute, second = time.split(":")
        return cls(int(hour), int(minute), int(second))

    def __eq__(self, other) -> bool:
        return self._hour == other._hour and self._minute == other._minute and self._second == other._second

    def __add__(self, other: "Time") -> "Time":
        if isinstance(other, Time):
            return Time(self._hour + other._hour, self._minute + other._minute, self._second + other._second)
        raise ValueError(f"Time can only be added to another Time object, not {type(other)}")

    def __sub__(self, other: "Time") -> "Time":
        if isinstance(other, Time):
            return Time(self._hour - other._hour, self._minute - other._minute, self._second - other._second)
        raise ValueError(f"Time can only be subtracted from another Time object, not {type(other)}")

    def __lt__(self, other) -> bool:
        if isinstance(other, Time):
            return self._hour < other._hour or self._hour == other._hour and self._minute < other._minute or self._hour == other._hour and self._minute == other._minute and self._second < other._second
        raise ValueError(f"Time can only be compared with another Time object, not {type(other)}")

    def __le__(self, other) -> bool:
        if isinstance(other, Time):
            return self < other or self == other
        raise ValueError(f"Time can only be compared with another Time object, not {type(other)}")

    def __gt__(self, other) -> bool:
        if isinstance(other, Time):
            return not self <= other
        raise ValueError(f"Time can only be compared with another Time object, not {type(other)}")

    def __ge__(self, other) -> bool:
        if isinstance(other, Time):
            return not self < other
        raise ValueError(f"Time can only be compared with another Time object, not {type(other)}")

