import heapq

class Solution:
    def open_the_club(self, stdin):
        n = int(stdin[0])
        arr = stdin[1]
        count_W, count_M = 0, 0
        for c in arr:
            if c == "W":
                count_W += 1
            else:
                count_M += 1
        res = abs(count_W - count_M)
        if res > n:
            return n
        return res

    def open_the_club_better(self, stdin):
        n = int(stdin[0])
        arr = stdin[1]
        count_W, count_M = 0, 0
        res = float('inf')
        for c in arr:
            if c == "W":
                count_W += 1
            else:
                count_M += 1
        res = min(res, abs(count_W - count_M))
        if res > n:
            return n
        return res

    def open_the_club_heapq(self, stdin):
        n = int(stdin[0])
        arr = stdin[1]
        res = 0
        h = []
        for c in arr:
            if c == "W":
                heapq.heappush(h, -1 * len(h))
            else:
                if h:
                    heapq.heappop(h)
        return -1 * h[0] if h else n

