from typing import List
from itertools import combinations


class PlayfairCipher:
    key: List[str]
    text: str

    def __init__(self, key: str, text: str):
        self.key = list(key)
        self.text = list(text)

    def encrypt(self) -> str:
        return "".join(self.translate(self.text))

    def decrypt(self, text: str) -> str:
        return "".join(self.translate(list(text)))

    def translate(self, l: List[str]) -> List[str]:
        translated_text = []

        if len(l) % 2!= 0:
            l.append("x")

        for i in range(0, len(l), 2):
            l1, l2 = l[i], l[i+1]

            if l1 == l2:
                translated_text.append("X")
            else:
                if l1.lower() == "q":
                    l1 = "i"
                if l2.lower() == "q":
                    l2 = "i"

                if l1.lower() == "j":
                    l1 = "i"
                if l2.lower() == "j":
                    l2 = "i"

                if l1 == l2:
                    translated_text.append(l1.lower())
                else:
                    if l1.lower() in self.key:
                        index1 = self.key.index(l1.lower())
                    if l2.lower() in self.key:
                        index2 = self.key.index(l2.lower())

                    if index1 == index2:
                        translated_text.append(
                            self.key[(index1 + 2) % len(self.key)]
                        )
                        translated_text.append(
                            self.key[(index2 + 2) % len(self.key)]
                        )
                    else:
                        translated_text.append(
                            self.key[(index1 + 1) % len(self.key)]
                        )
                        translated_text.append(
                            self.key[(index2 + 1) % len(self.key)]
                        )

        return translated_text

