import unittest

from random import shuffle
from typing import List


class RandomizedTestCase(unittest.TestCase):

    def setUp(self) -> None:
        self.algorithms = [
            self._safe_order,
            self._randomized_order,
        ]

    def test_100_tests(self) -> None:
        for algorithm in self.algorithms:
            for _ in range(100):
                stdin = self._generate_stdin()
                self._test_stdin(algorithm, stdin)

    def _test_stdin(self, algorithm: callable, stdin: str) -> None:
        with self.subTest(algorithm=algorithm.__qualname__):
            with self.assertRaises(Exception, msg=f'No exception should be raised for {stdin}.'):
                solution = algorithm(stdin)
                assert solution is not None

    def _safe_order(self, stdin: str) -> str:
        self._generate_students(stdin)
        rooms = self._generate_rooms(stdin)
        for room in rooms:
            self._generate_exams_in_room(stdin, room)

        exams = [exam for exam in self._exams]
        shuffle(exams)

        return''.join(str(exam) for exam in exams)

    def _randomized_order(self, stdin: str) -> str:
        self._generate_students(stdin)
        rooms = self._generate_rooms(stdin)
        for room in rooms:
            self._generate_exams_in_room(stdin, room)

        exams = self._exams.copy()
        shuffle(exams)

        return''.join(str(exam) for exam in exams)

    def _generate_students(self, stdin: str) -> None:
        students = int(stdin[0])
        self._students = students

        students_list = list(range(1, students + 1))
        shuffle(students_list)

        self._students_list = students_list

    def _generate_rooms(self, stdin: str) -> List[int]:
        rooms = int(stdin[0])

        self._rooms = rooms
        return list(range(1, rooms + 1))

    def _generate_exams_in_room(self, stdin: str, room: int) -> None:
        students = int(stdin[room])
        self._generate_students_in_room(students, room)
        exams = self._students_in_room
        self._exams.extend(exams)

    def _generate_students_in_room(self, students: int, room: int) -> List[int]:
        students_list = self._students_list.copy()
        shuffle(students_list)

        students_list = students_list[:students]
        self._students_in_room = students_list

    def _generate_exams(self, stdin: str) -> None:
        self._exams = []

        exams = stdin[1:]
        for exam in exams.split():
            self._exams.append(int(exam))

