n = int(input())

for i in range(n):
    s = list(map(int, input().split()))
    s.sort()
    s = s[::-1]
    sum = 0
    for j in range(len(s)):
        sum += s[j]
    if sum % n!= 0:
        print("impossible")
        break
    else:
        s = s[::-1]
        s = s[:-1]
        if s == []:
            print("impossible")
            break
        else:
            while len(s)!= 0:
                a = list(map(str, input().split()))
                for j in range(len(a)):
                    if a[j] == "1":
                        print(s[0], end=" ")
                        s.pop(0)
                        break
            print()
